// IMPORT ICONS
import iconReact from "./Icons/react-icon.png"
import iconCSS from "./Icons/css-icon.png";
import iconPython from "./Icons/python-icon.png";
import iconGithub from "./Icons/github-icon.png";
import iconLinkedIn from "./Icons/linkedin-icon.png";
import iconJS from "./Icons/js-icon.png"
import iconPhotoshop from "./Icons/photoshop-icon.png"

import iconPortfolio from "./Icons/portfolio-icon.png"

import loaderLogo from "./Icons/loader-logo-tn.png"

import fotoHello from "./Photos/foto-tomas.png"
import fotoContact from "./Photos/foto2-tomas.png"


export {iconReact, iconCSS, iconPython, iconJS, iconPhotoshop, iconGithub, iconLinkedIn};
export {iconPortfolio}
export {loaderLogo}
export {fotoHello}
export {fotoContact}
